import Navbar from './components/Navbar';
import Home from './pages/Home'

function App () {
  return (
    <div className="App">
      <BrowserRouter>
       <Navbar></Navbar>
        <div className="container">
          <Home/>
        </div>
      </BrowserRouter>
    </div>
  );
};

export default App;
